import React from "react";
import { useLocation } from "react-router-dom";
import { HashLink, NavHashLink } from 'react-router-hash-link';

function NavTabs() {
    const location = useLocation();

    return (
        <>
            <HashLink to="#" className="navbar-brand align-top">
                <img src="../images/logo.png" width="120" height="80" alt="michael scales logo" />
            </HashLink>
            <nav className="navbar fixed-top mt-2 mx-2 navbar-expand-lg navbar-dark ">

                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse justify-content-end flex-column" id="navbarNav">

                    <NavHashLink
                        to="/#projects"
                        className={location.pathname === "/#projects" ? "nav-link active" : "nav-link"}
                    >
                        Projects
                    </NavHashLink>

                    <NavHashLink
                        to="/#about"
                        className={location.pathname === "/#about" ? "nav-link active" : "nav-link"}
                    >
                        About
                    </NavHashLink>

                    <NavHashLink
                        to="/#resume"
                        className={location.pathname === "/#resume" ? "nav-link active" : "nav-link"}
                    >
                        Resume
                    </NavHashLink>

                </div>
            </nav>
        </>
    );
}

export default NavTabs;
